INSERT INTO `t_company` VALUES (1, '河北航空', 'https://p1.meituan.net/airlinelogo/NS.png', '河北航空有限公司（中文简称河北航空，英文简称Hebei Airlines），是河北航空投资集团有限公司的核心企业。2010年6月29日，河北省对外宣布：河北航空投资集团及河北航空公司于当日在石家庄国际机场挂牌成立。河北航空公司是经中国民航局批准，由河北航空投资集团有限公司控股、四川航空集团公司和沈阳中瑞公司参股的现代化航空公司。公司主要运营基地为石家庄正定国际机场，主营航空客、货、邮运输业务，兼营通用航空业务以及与航空运输相关业务。');
INSERT INTO `t_company` VALUES (2, '南方航空', 'https://p1.meituan.net/airlinelogo/CZ.png', '中国南方航空股份有限公司是由中国南方航空集团公司发起设立，以原中国南方航空公司基础，联合中国北方航空公司、新疆航空公司和重庆航空公司重组而成的航空运输主业公司。是中国南方航空集团公司发起设立并控股的航空公司。中国南方航空股份有限公司1997年分别在纽约（NYSE：ZNH）和香港（港交所：1055）同步上市发行股票，2003年在上海证券交易所成功上市（上交所：600029）。');
INSERT INTO `t_company` VALUES (3, '东方航空', 'https://p1.meituan.net/airlinelogo/MU.png', '中国东方航空集团公司总部设在上海，是我国三大骨干航空运输集团之一。经营业务包括公共航空运输、通用航空业务及与航空运输相关产品的生产和销售、航空器材及设备的维修、航空客货及地面代理、飞机租赁、航空培训与咨询等业务。截至2010年1月，东航集团总资产约为1085亿元人民币，拥有大中型运输飞机330多架，通用航空飞机18架，通航点151个，从业人员超过6万人。');
INSERT INTO `t_company` VALUES (4, '厦门航空', 'https://p1.meituan.net/airlinelogo/MF.png', '厦门航空有限公司，成立于1984年7月，是中国民用航空局和福建省合作创办的、中国首家按现代企业制度运行的航空公司，目前股东为中国南方航空股份有限公司（占51%股权）、厦门建发集团有限公司（占34%股权）和河北航空投资集团有限公司（占15%股权）。厦门航空承运人代码为“MF”，企业标志为“蓝天白鹭”。厦门航空成立于1984年7月25日，是由当时的国家民航局和福建省、厦门市政府共同出资，各自指定企业股东创办。');
INSERT INTO `t_company` VALUES (5, '海南航空', 'https://p1.meituan.net/airlinelogo/HU.png', '海南航空股份有限公司（以下简称海南航空）于1993年1月成立，起步于中国最大的经济特区海南省，是中国发展最快和最有活力的航空公司之一，致力于为旅客提供全方位无缝隙的航空服务。    海南航空拥有波音737、767系列和空客330、340系列为主的年轻豪华机队，适用于客运和货运飞行。1993年至今，海南航空在以海口为主基地的基础上，先后建立了北京、西安、太原、乌鲁木齐、广州、兰州、大连、深圳八个航空营运基地，航线网络遍布中国。');
INSERT INTO `t_company` VALUES (6, '深圳航空', 'https://p1.meituan.net/airlinelogo/ZH.png', '深圳航空有限责任公司(以下简称“深航”) 于1992年11月成立，1993年9月17日正式开航。股东为中国国际航空股份有限公司、深国际全程物流(深圳)有限公司等，主要经营航空客、货、邮运输业务。截止2010年7月,深航及其控股的河南航空、昆明航空、翡翠货运等4家航空公司共拥有波音747、737，空客320、319等各类型干线客货机逾百架，经营国内国际航线160多条。');
INSERT INTO `t_company` VALUES (7, '华夏航空', 'https://p1.meituan.net/airlinelogo/G5.png', '华夏航空是中国第一家专门从事支线客货运输的民营航空公司，也是目前国内唯一一家独立的支线航空公司，明确奉行支线战略定位。截至目前，华夏航空执飞航线32条，其中非竞争航线25条，非竞争航线比例为78%。在所有航线中，机场年吞吐量为30万人次以下的支线航线共有19条，占公司所飞航线总数的60％，其中贫瘠机场三个（兴义、黎平、赣州），占全国贫瘠机场总数的15％。');
INSERT INTO `t_company` VALUES (8, '中国国航', 'https://p1.meituan.net/airlinelogo/CA.png', '中国国际航空股份有限公司简称“国航”，英文名称为“Air China Limited”，简称“Air China”，其前身中国国际航空公司成立于1988年。根据国务院批准通过的《民航体制改革方案》，2002年10月，中国国际航空公司联合中国航空总公司和中国西南航空公司，成立了中国航空集团公司，并以联合三方的航空运输资源为基础，组建新的中国国际航空公司。');
INSERT INTO `t_company` VALUES (9, '春秋航空', 'https://p1.meituan.net/airlinelogo/9C.png', '春秋航空（Spring Airlines）股份有限公司，是首个中国民营资本独资经营的低成本航空公司专线，也是首家由旅行社起家的低成本航空公司。春秋航空是国内首家低成本航空公司,2011 年净利润逾4.7 亿元，成为当前国内最成功的低成本航空公司，总部在上海，在上海虹桥机场、上海浦东机场、石家庄正定机场、沈阳桃仙机场、扬州泰州国际机场设有基地。');
INSERT INTO `t_company` VALUES (10, '上海航空', 'https://p1.meituan.net/airlinelogo/FM.png', '上海航空公司成立于1985年12月，是中国国内第一家由地方投资组建的商业化运营的航空公司。2010年1月28日，以东航换股吸收合并上航的联合重组顺利完成，上航成为新东航的成员企业。2010年5月28日，作为东航全资子公司的上海航空有限公司正式挂牌运营。');
INSERT INTO `t_company` VALUES (11, '吉祥航空', 'https://p1.meituan.net/airlinelogo/HO.png', '上海吉祥航空股份有限公司（简称“吉祥航空”)，系“中国民企百强”企业――均瑶集团的全资控股航空公司，注册资本为3亿元人民币。吉祥航空以上海为主运营基地和维修基地，以上海虹桥国际机场和浦东国际机场为飞行基地，经营范围包括国内航空客货邮运输、商务旅游包机业务，内地至香港、澳门特别行政区和周边国家的航空客货运输业务。');
INSERT INTO `t_company` VALUES (12, '东海航空', 'https://p1.meituan.net/airlinelogo/DZ.png', '深圳东海航空有限公司（Shenzhen Donghai Airlines Co., Ltd.），前身为“深圳捷晖货运航空有限公司”。成立于2002年11月，是经国家商务部、民航总局批准成立的国内首家民营中外合资货运航空公司。');
INSERT INTO `t_company` VALUES (13, '中国联航', 'https://p1.meituan.net/airlinelogo/KN.png', '中国联合航空有限公司（China United Airlines，简称“中国联航”）成立于1984年9月21日。 中国联合航空是中国东方航空集团的核心成员品牌。中国联航于2012年11月26日完成机构重组扩张并正式运营。中联航以北京大兴国际机场为主运营基地，下设中联航河北分公司（石家庄正定国际机场），北京南苑联合机场管理服务有限公司（北京南苑机场），佛山沙堤机场管理有限公司（广东佛山）。');
